create table t_role_permission
(
  id            varchar(255) not null
    constraint t_role_permission_pkey
      primary key,
  create_by     varchar(255) default NULL::character varying,
  create_time   timestamp,
  del_flag      integer,
  update_by     varchar(255) default NULL::character varying,
  update_time   timestamp,
  permission_id varchar(255) default NULL::character varying,
  role_id       varchar(255) default NULL::character varying
);

alter table t_role_permission
  owner to postgres;

